import datetime
import json
import os
import uuid
from typing import Dict, List, Optional
from functools import lru_cache
import pandas as pd
from fastapi import FastAPI, HTTPException, UploadFile, File, status
from pydantic import BaseModel

app = FastAPI()

# Mock database for demonstration
class Database:
    def __init__(self):
        self.submissions = {}
        self.published_files = {}
        self.user_testing_sessions = []
        self.resources = []

db = Database()

# Models
class Submission(BaseModel):
    submission_id: str
    status: str
    user_id: str
    file_data: Optional[dict] = None
    funding_agency_codes: Optional[List[str]] = None
    created_at: datetime.datetime = datetime.datetime.now()

class DFilesCache:
    _instance = None

    def __new__(cls):
        if cls._instance is None:
            cls._instance = super().__new__(cls)
            cls._instance.cache = {}
        return cls._instance

    def get(self, key: str) -> Optional[dict]:
        return self.cache.get(key)

    def set(self, key: str, value: dict):
        self.cache[key] = value

class UserTestingSession(BaseModel):
    session_id: str
    agency: str
    scheduled_time: datetime.datetime
    participants: List[str]
    findings: Optional[str] = None

class Resource(BaseModel):
    resource_id: str
    title: str
    url: str
    category: str

# Helper functions
def generate_id():
    return str(uuid.uuid4())

def validate_file(file_data: dict) -> Dict[str, List[str]]:
    errors = []
    warnings = []

    # Simple validation logic
    if not file_data.get("content"):
        errors.append("File content is empty")
    if len(file_data.get("content", "")) > 100000:
        warnings.append("File is unusually large")

    return {"errors": errors, "warnings": warnings}

def derive_funding_agency_codes(submission_data: dict) -> List[str]:
    # Simple derivation logic
    codes = []
    if "NIH" in submission_data.get("content", ""):
        codes.append("NIH")
    if "NSF" in submission_data.get("content", ""):
        codes.append("NSF")
    return codes if codes else ["OTHER"]

# API Endpoints
@app.delete("/data/{date}")
def process_deletions(date: str):
    try:
        target_date = datetime.datetime.strptime(date, "%Y-%m-%d").date()
    except ValueError:
        raise HTTPException(status_code=400, detail="Invalid date format. Use YYYY-MM-DD")

    # Mock deletion process
    to_delete = [
        sub_id for sub_id, sub in db.submissions.items()
        if sub.created_at.date() < target_date
    ]

    for sub_id in to_delete:
        db.submissions.pop(sub_id)

    return {"message": f"Deleted {len(to_delete)} outdated records", "date": date}

@app.put("/submissions/{submission_id}/status")
def update_submission_status(submission_id: str, new_status: str):
    submission = db.submissions.get(submission_id)
    if not submission:
        raise HTTPException(status_code=404, detail="Submission not found")

    submission.status = new_status
    return {"message": "Status updated", "submission_id": submission_id, "new_status": new_status}

@app.post("/submissions/validate")
def validate_submission(file: UploadFile = File(...)):
    file_data = {"filename": file.filename, "content": file.file.read().decode()}
    validation_result = validate_file(file_data)
    return {"validation": validation_result}

@app.post("/generate-d-file")
def generate_d_file(fabs_data: dict, fpds_data: dict):
    # Combine data from FABS and FPDS
    combined_data = {**fabs_data, **fpds_data}

    # Simple processing example
    d_file = {
        "d_file_id": generate_id(),
        "generated_at": datetime.datetime.now(),
        "data": combined_data
    }

    # Cache the result
    cache_key = f"{hash(json.dumps(fabs_data))}-{hash(json.dumps(fpds_data))}"
    DFilesCache().set(cache_key, d_file)

    return d_file

@app.get("/d-file/{cache_key}")
def get_cached_d_file(cache_key: str):
    cached = DFilesCache().get(cache_key)
    if not cached:
        raise HTTPException(status_code=404, detail="Cached file not found")
    return cached

@app.post("/submissions")
def create_submission(file: UploadFile = File(...)):
    file_data = {"filename": file.filename, "content": file.file.read().decode()}
    submission_id = generate_id()
    funding_agency_codes = derive_funding_agency_codes(file_data)

    submission = Submission(
        submission_id=submission_id,
        status="received",
        user_id="current_user",  # In real app, get from auth
        file_data=file_data,
        funding_agency_codes=funding_agency_codes
    )

    db.submissions[submission_id] = submission
    return {"message": "Submission created", "submission_id": submission_id, "funding_agency_codes": funding_agency_codes}

@app.put("/resources")
def update_resources_page(resources: List[Resource]):
    db.resources = resources
    return {"message": "Resources page updated", "count": len(resources)}

@app.post("/user-testing/sessions")
def schedule_user_testing_session(agency: str, scheduled_time: datetime.datetime, participants: List[str]):
    session = UserTestingSession(
        session_id=generate_id(),
        agency=agency,
        scheduled_time=scheduled_time,
        participants=participants
    )
    db.user_testing_sessions.append(session)
    return {"message": "Session scheduled", "session_id": session.session_id}

@app.put("/user-testing/sessions/{session_id}/report")
def report_user_testing_results(session_id: str, findings: str):
    session = next((s for s in db.user_testing_sessions if s.session_id == session_id), None)
    if not session:
        raise HTTPException(status_code=404, detail="Session not found")

    session.findings = findings
    return {"message": "Findings recorded", "session_id": session_id}

@app.get("/published-files")
def get_published_files():
    return {"files": list(db.published_files.values())}

@app.post("/api/upload")
def api_upload(file: UploadFile = File(...)):
    file_data = {"filename": file.filename, "content": file.file.read().decode()}
    file_id = generate_id()
    db.published_files[file_id] = file_data
    return {"message": "File uploaded via API", "file_id": file_id}
